import NavBar from "./components/navbar/navbar.jsx";

import React from 'react';

const Header = () => {
  return <>
    <div id="bg-superior">
        <NavBar />
        <div id="logo-banner" className="" align="left"/>
        <div id="bg-superior-inner"/>
    </div>;
    </>
}

export default Header;
